import styled from "styled-components"
import { Link } from 'react-router-dom';
export const AppDiv = styled('div')`
  height: 5.375rem;
  top:0px;
  left:0px;
  position: fixed;
  width: 100%;
  z-index: 9;
  border-bottom: 1px solid rgba(83, 83, 83, 0.13);
  padding: 1.5rem 4rem;
  display: flex;
  background-color: rgb(255, 255, 255);
  justify-content: space-between;
  align-items: center;

`;

export const StyledImage = styled('img')`
 
  max-width: 97px; // Adjust the maximum width as needed
  height: 37px;
 


  &:hover{
    cursor:pointer;
  }
`;

export const CenterAppbar = styled('div')`
  display: inline-flex;
  gap: 2rem;
  flex: 0 1 auto;
  justify-content: center;
  place-self: center;
  margin: 0px;
  padding: 0px;
  list-style: none;
`;

export const StyledLink=styled(Link)`
  color: rgb(107 ,107,107);
  padding:5px;
  font-weight: bold;
  text-decoration: none; 
  &:hover {
   
    cursor: pointer;
  }

` 
export const CardOuterDiv=styled('div')`

`
